import React, { useState } from "react";
import Container from "@material-ui/core/Container";
import { REDUCEPRODUCTS } from "../shared/reduceproducts";
import { REDUCETIPS } from "../shared/reducetips";
import { REDUCEWASTE } from "../shared/reducewaste";
import { Card, CardContent, CardMedia, Typography } from "@material-ui/core";
import { CardActionArea } from "@material-ui/core";
import { makeStyles } from "@material-ui/core";
import { useHistory } from "react-router-dom";
import { CallMissedSharp } from "@material-ui/icons";

const reduceWaste = REDUCEWASTE;
const reduceTips = REDUCETIPS;
const reduceProducts = REDUCEPRODUCTS;

const useStyles = makeStyles({
  cardContainer: {
    display: "flex",
  },
  card: {
    display: "inline-block",
    border: "1px solid #e0e0e0",
    margin: 20
  },
});

export default function Reduce() {
  const classes = useStyles();
  return (
    <Container size='sm'>
      <h1>Reduce</h1>
      <div className={classes.cardContainer}></div>
      {reduceProducts.map((product) => {
        return (
          <Card sx={{ maxWidth: 345 }} key={product.id}>
            <CardActionArea>
              <CardMedia
                component='img'
                height='140'
                image={product.src}
                alt='nada'
              />
              <CardContent>
                <Typography gutterBottom variant='h5' component='div'>
                  {product.title}
                </Typography>
                <Typography variant='body2' color='text.secondary'>
                  {product.description}
                </Typography>
                <Typography variant='body2' color='text.secondary'>
                  {product.price}
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        );
      })}
    </Container>
  );
}
